import React, {Component} from 'react';
import logo from './logo.svg';
import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import Layout from './../src/hoc/Layout/Layout';
import { Redirect, Route, Switch, withRouter } from 'react-router-dom';
import { RouterSharp } from '@material-ui/icons';

class App extends Component {
  render(){
    let routes = (
    <Layout>
      <Switch>
        <Route exact path="/" component={Dashboard}/>
        <Route exact path="/dashboard" component={Dashboard}/>
        <Route exact path="/emails" component={Postfach}/>
        <Route exact path="/settings" component={Einstellungen}/>
        <Route exact path="/profile" component={Profil}/>
        <Route exact path="/profile/passwort" component={ChangePassword}/>
        <Route exact path="/settings/user/add" component={AddUser}/>
        <Route exact path="/settings/user/edit" component={AddUser}/>
        <Route exact path="/settings/spending/add" component={AddSpending}/>
        <Route exact path="/settings/spending/edit" component={AddSpending}/>
        <Redirect to="/"/>
      </Switch>
    </Layout>
    )
  
  return(
    <div>
      {routes}
    </div>
  );
}
}
export default App;
